let message_AR = ref();
let message_EN = ref();
let rate = ref(5);

let loading = ref(false);
let reviews = ref();
const getreviews = async () => {
  loading.value = true;
  if (locale.value === "ar") {
    const { data: productsData, pending } = await useFetch(
      `${api.GetReviews}`,
      {
        credentials: "include",
        baseURL: apiBase,
        headers: {
          "accept-language": "ar",
        },
      }
    );
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          reviews.value = productsData.value;
        }
      }
    });
  } else {
    const { data: productsData, pending } = await useFetch(
      `${api.GetReviews}`,
      {
        credentials: "include",
        baseURL: apiBase,
        headers: {
          "accept-language": "en",
        },
      }
    );
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          reviews.value = productsData.value;
        }
      }
    });
  }
  loading.value = false;
};
// init
getreviews();

const addCat = async () => {
  const { AddProduct, error } = await useFetch(api.AddReview, {
    baseURL: apiBase,
    credentials: "include",
    method: "POST",
    body: {
      customer_name_AR: customer_name_AR.value,
      customer_name_EN: customer_name_EN.value,
      message_AR: message_AR.value,
      message_EN: message_EN.value,
      rate: rate.value,
    },
  });

  visible.value = false;
  customer_name_AR.value = "";
  customer_name_EN.value = "";
  message_AR.value = "";
  message_EN.value = "";
  rate.value = 5;

  getreviews();
  //message
  locale.value === "en"
    ? $awn.success("Review Added Successfully", {
        durations: { global: 5000 },
      })
    : $awn.success("تم إضافة المراجعة بنجاح", {
        durations: { global: 5000 },
      });
};

