  } else {
    const { data: productsData, pending } = await useFetch(
      `${api.GetReviews}`,
      {
        credentials: "include",
        baseURL: apiBase,
        headers: {
          "accept-language": "en",
        },
      }
    );
    watchEffect(() => {
      if (process.client) {
        if (productsData.value) {
          reviews.value = productsData.value;
        }
      }
    });
  }
  loading.value = false;
