      customer_name_EN: customer_name_EN.value,
      message_AR: message_AR.value,
      message_EN: message_EN.value,
      rate: rate.value,
    },
  });

  visible.value = false;
  customer_name_AR.value = "";
  customer_name_EN.value = "";
  message_AR.value = "";
  message_EN.value = "";
  rate.value = 5;

  getreviews();
  //message
  locale.value === "en"
